import React from 'react';

function CardInput(props) {
  return (
    <fieldset>
      <input 
        name={props.name} 
        id={props.id} 
        type={props.type || 'text'} 
        placeholder={props.placeholder} 
        required 
      />
    </fieldset>
  );
}

export default CardInput;
